        <h4 class=""mt-4 mb-3"">
            1.&nbsp;什麼是私有建築物耐震階段性補強? 辦理耐震階段性補強的好處 ？
        </h4>
        <p class=""mb-3"">
            &emsp;&emsp;有鑑於過去歷次大地震倒塌的建築物，其倒塌主要原因係軟弱層之破壞模式，若能於建築物底層增加補強構件，提供短期緊急處置措施，即可大幅降低建物於大地震來襲時瞬間崩塌之風險。
        </p>
        <p class=""mb-4"">
            &emsp;&emsp;因此，耐震階段性補強其目的，乃在排除建築物底層軟弱層破壞之短期緊急性處理措施，僅需花費較少的經費，即可大幅降低建物於大地震來襲時瞬間崩塌的風險，以降低倒塌或大規模傷亡的機率，達到確保生命安全之目的。
        </p>
        <h4 class=""mt-4 mb-3"">
            2.&nbsp;為什麼要做耐震補強？
        </h4>
        <p class=""mb-3"">
            &emsp;&emsp;因臺灣地震頻繁，地震災害的發生時常造成民眾生命財產的損失，房屋隨著屋齡增加造成強度老化或耐震設計法規的更新等因素，部分早期興建的房子可能潛在耐震能力不足，將使其於地震來襲時承受較大的風險。為防患於未然，一定年限之老舊房屋有必要進行耐震補強，來提升建築物的耐震能力。
        </p>
        <p class=""mb-4"">
